import React, { useState } from 'react';
import '../styles/ObjetiveSelection.scss';

const ObjectiveSelection = ({ players }) => {

    const handlePlayerClick = (player) => {
        console.log(`${player}`);
        setShowObjetives(false);
    }

    return (
        <div className='objetive-selection-container'>
            <table>
                <thead>
                    <tr>
                        <th>Selecciona a tu objetivo</th>
                    </tr>
                </thead>
                <tbody>                
                    {players.map((player, index) => (
                        <tr key={index}>
                            <td>
                                <button 
                                    className='player-objetive-button' 
                                    onClick={() => handlePlayerClick(player)}
                                >
                                    {player}
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ObjectiveSelection;
